package dev.tonholo.awesomeapp.navigationimport androidx.navigation.NavGraphBuilderimport androidx.navigation.compose.composableimport dev.tonholo.awesomeapp.features.feed.FeedScreensealed interface Destination {    val route: String    fun setup(builder: NavGraphBuilder)}object Destinations {    val startDestination = Feed.route    object Feed : Destination {        override val route = "feed"        override fun setup(builder: NavGraphBuilder) = with(builder) {            composable(this@Feed.route) {                FeedScreen()            }        }    }    fun NavGraphBuilder.setupRoutes() {        Feed.setup(this)    }}